import '../css/main.css';
import { StyleSheet, View, } from 'react-native';

//Import images
import instagram from '../assets/img/instagram.png';
import facebook from '../assets/img/facebook.png';

export default function Footer() {
    return(
        <View style={styles.footer}>
            <View style={styles.socials} >
                <a href="https://www.instagram.com/hwang_skitchen/?hl=en">
                    <img src={instagram} alt="instagram icon" />
                </a>
                <a href="https://m.facebook.com/HwangsKitchen/">
                    <img src={facebook} alt="facebook icon" />
                </a>
            </View>
            <View>
                <a href="mailto:hwangskitchencoq@gmail.com">hwangskitchencoq@gmail.com</a>
                <a href="tel:6044695559">(604) 469 - 5559</a>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
      paddingTop: 40,
      paddingLeft: 10,
      paddingRight: 10,
      paddingBottom:15
    },
    footer: {
      alignItems: "center",
      flex:1,
    },
    socials: {
        flexDirection: 'row'
    }
  });
